var radius_input;
var number_input;
var bar;
var radius;
var number;




function recommend(){

	bar=document.getElementById('bar-input').value;
	console.log(bar);

	radius=document.getElementById('radius-input').value;
	console.log(radius);

	number=document.getElementById('number-input').value;
	console.log(number);


	console.log("here");
       $.ajax({
         type: "POST",
         contentType: "application/json; charset=utf-8",
         url: "/recommend",
         dataType: "json",
         async: true,
         data: "{\"example\": [\""+bar+"\","+radius+","+number+"]}",
         success: function (data) {
           bars = data["score"];
					 draw_markers();
         },
         error: function (result) {
         }
       })
     }





function draw_markers() {


			for (let i=0; i < bars.length; i++) {

				let name = bars[i].name;
				let neighborhood = bars[i].neighborhood;
				let price = bars[i].price;
				let url = bars[i].url;

				mapObj.addMarker({
			  lat: bars[i].lat,
			  lng: bars[i].lng,
			  title: bars[i].name,
				infoWindow: {
			    content: name+'<br>'+neighborhood+'<br>'+price+'<br>'+url,
			    maxWidth: 200
			}})




		};

		for (let i=0; i < bars.length-1; i++) {

			mapObj.drawRoute({
		  origin: [bars[i].lat, bars[i].lng],
		  destination: [bars[i+1].lat, bars[i+1].lng],
		  travelMode: 'walking',
		  strokeColor: '#131540',
		  strokeOpacity: 0.6,
		  strokeWeight: 6
		});


		}
}


